import React from 'react';
import { Question } from '../types';

interface QuestionPromptProps {
    question: Question;
}
const QuestionPrompt: React.FC<QuestionPromptProps> = ({ question }) => {
    return (
        <div>
            <h1>Question</h1>
            <h3>{question.prompt}</h3>
        </div>
    )
};

export default QuestionPrompt;
